message:
O DECÁLOGO DE LÊNIN:
   1. Corrompa a juventude e dê-lhe liberdade sexual;
   2. Infiltre e depois controle todos os veículos de comunicação de massa;
   3. Divida a população em grupos antagônicos, incitando-os a discussões sobre assuntos sociais;
   4. Destrua a confiança do povo em seus líderes;
   5. Fale sempre sobre Democracia e em Estado de Direito, mas, tão logo haja oportunidade, assuma o Poder sem nenhum escrúpulo;
  6. Colabore para o esbanjamento do dinheiro público; coloque em descrédito a imagem do País, especialmente no exterior e provoque o pânico e o desassossego na população por meio da inflação;
   7. Promova greves, mesmo ilegais, nas indústrias vitais do País;
   8. Promova distúrbios e contribua para que as autoridades constituídas não as coíbam;
   9. Contribua para a derrocada dos valores morais, da honestidade e da crença nas promessas dos governantes. Nossos parlamentares infiltrados nos partidos democráticos devem acusar os não-comunistas, obrigando-os, sem pena de expô-los ao ridíc
